import React from 'react';
import { motion } from 'framer-motion';
import { FaJava } from 'react-icons/fa'; // Java icon from FontAwesome
import {
  SiPython,
  SiCplusplus,
  SiHtml5,
  SiCss3,
  SiJavascript,
  SiTailwindcss,
  SiReact,
  SiFirebase,
  SiMongodb,
  SiMysql,
  SiOpencv,
  SiTesseract,
  SiGit,
  SiVisualstudiocode,
  SiMachinelearning,
  SiBigbluebutton,
} from 'react-icons/si';
import { MdStorage, MdOutlineDesignServices, MdOutlineGroups, MdOutlineWatchLater, MdOutlineHeadsetMic, MdOutlinePsychology } from 'react-icons/md';

const skillsData = [
  {
    category: 'Languages',
    icon: <SiJavascript className="text-purple-400" size={24} />,
    skills: [
      { icon: <FaJava className="text-purple-400" size={18} />, label: 'Java' },
      { icon: <SiPython className="text-purple-400" size={18} />, label: 'Python' },
      { icon: <SiCplusplus className="text-purple-400" size={18} />, label: 'C++' },
      { icon: <SiJavascript className="text-purple-400" size={18} />, label: 'JavaScript' },
      { icon: <SiHtml5 className="text-purple-400" size={18} />, label: 'HTML' },
      { icon: <SiCss3 className="text-purple-400" size={18} />, label: 'CSS' },
      { icon: <SiTailwindcss className="text-purple-400" size={18} />, label: 'Tailwind CSS' },
      { icon: <SiReact className="text-purple-400" size={18} />, label: 'React.js' },
    ],
  },
  {
    category: 'Backend & Databases',
    icon: <MdStorage className="text-purple-400" size={24} />,
    skills: [
      { icon: <SiFirebase className="text-purple-400" size={18} />, label: 'Firebase' },
      { icon: <SiMongodb className="text-purple-400" size={18} />, label: 'MongoDB' },
      { icon: <SiMysql className="text-purple-400" size={18} />, label: 'MySQL' },
    ],
  },
  {
    category: 'Tools & Libraries',
    icon: <SiGit className="text-purple-400" size={24} />,
    skills: [
      { icon: <SiOpencv className="text-purple-400" size={18} />, label: 'OpenCV' },
      { icon: <SiTesseract className="text-purple-400" size={18} />, label: 'Tesseract OCR' },
      { icon: <SiGit className="text-purple-400" size={18} />, label: 'Git' },
      { icon: <SiVisualstudiocode className="text-purple-400" size={18} />, label: 'VS Code' },
    ],
  },
  {
    category: 'Concepts',
    icon: <MdOutlineDesignServices className="text-purple-400" size={24} />,
    skills: [
      { icon: <MdOutlineDesignServices className="text-purple-400" size={18} />, label: 'OOP' },
      { icon: <MdStorage className="text-purple-400" size={18} />, label: 'DBMS' },
      { icon: <SiBigbluebutton className="text-purple-400" size={18} />, label: 'Data Structures' },
      { icon: <SiMachinelearning className="text-purple-400" size={18} />, label: 'Machine Learning' },
      { icon: <MdOutlineGroups className="text-purple-400" size={18} />, label: 'Big Data' },
      { icon: <MdOutlineDesignServices className="text-purple-400" size={18} />, label: 'UI/UX Principles' },
    ],
  },
  {
    category: 'Key Strengths',
    icon: <MdOutlinePsychology className="text-purple-400" size={24} />,
    skills: [
      { icon: <MdOutlineDesignServices className="text-purple-400" size={18} />, label: 'Problem Solving' },
      { icon: <MdOutlineGroups className="text-purple-400" size={18} />, label: 'Team Collaboration' },
      { icon: <MdOutlineHeadsetMic className="text-purple-400" size={18} />, label: 'Active Listener' },
      { icon: <MdOutlineWatchLater className="text-purple-400" size={18} />, label: 'Time Management' },
    ],
  },
];

const Skills = () => {
  return (
    <section id="skills" className="max-w-6xl mx-auto py-20 px-4 bg-[#0b0f19] text-white">
      <h2 className="text-4xl font-bold mb-16 text-center text-purple-400">Skills</h2>
      <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-8">
        {skillsData.map(({ category, icon, skills }) => (
          <motion.div
            key={category}
            className="bg-[#111827] p-6 rounded-lg shadow-md hover:shadow-purple-400/40"
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6, repeat: Infinity, repeatType: 'mirror', ease: 'easeInOut' }}
          >
            <div className="flex items-center space-x-3 mb-4">
              {icon}
              <h3 className="text-xl font-semibold text-purple-400">{category}</h3>
            </div>
            <ul className="flex flex-wrap gap-4 text-gray-300">
              {skills.map(({ icon, label }) => (
                <li key={label} className="flex items-center space-x-2 text-sm w-[48%]">
                  {icon}
                  <span>{label}</span>
                </li>
              ))}
            </ul>
          </motion.div>
        ))}
      </div>
    </section>
  );
};

export default Skills;
